note_models.css:
.card img {border-style:solid;border-width:0px;border-radius:10px;max-width:100%;max-height:none;}
.card 
{
  font-family: TakaoExGothic;
  font-size: 30px;
  text-align: center;
  background: #B0E8DC;
}

.expression
{
  font-family: 'TakaoExGothic';
  font-size: 40px;
}

.reading
{
  font-family: 'TakaoExGothic';
  font-size: 40px;
}

.focus
{
  font-size: 20px;
}

.meaning
{
  font-family: Arial;
  font-size:22px;
  opacity: 0.05;
}

.meaning:hover
{
  opacity: 1;
}

.sequence_marker
{
  font-family: Arial;
  font-size: 9px;
}

.media
{
  font-family: Arial;
  font-size: 28px;
}

.replaybutton span svg {
  stroke: grey;
  fill: dimgrey;
  opacity:0.5;
}
.replaybutton:hover span svg {
  opacity:1;
}

